import React  from "react";
import { useEffect } from "react";
import axios from "axios";
import { useState } from 'react';
import { Card } from "../components/Card";
import { CollapsableSection } from "../components/CollapsableSection";

export const Reference = () => {
  //const [content, setContent] = useState([{}]);
  const [groups, setGroups] = useState([{}]);

  const contentName = window.location.pathname;
  console.log(`${process.env.REACT_APP_URL_SERVER}${contentName}`)

  useEffect(() => {
    axios.get(`${process.env.REACT_APP_URL_SERVER}${contentName}`)
  .then(response => {
    //setContent(response.data.content)
    const allGroups = Object.groupBy(response.data.content, ({ group }) => group);
    console.log(allGroups)
    setGroups(allGroups)
  })
  }, [])

  return (
    <div>
      { groups.length > 0 ? 
      groups
        .map(content =>
          <CollapsableSection
            title={content.key}
            content={content.value}
          />
        )

        :

        <p>NO CONTENT</p>
    }
    </div>
  );
};
